tate_text:
X doesn’t hide his emotions. On his song “LETS PRETEND WE’RE NUMB,” he says;

I advise you to not hide your feelings, don’t pretend to be okay when you’re not okay, don’t pretend to be happy when you’re sad, it’ll only lead to your misery.

X also has a broken heart tattoo on his face that he could also be alluding to.
